import React from "react";

export default function About() {
  return (
    <div>
      <section id="about">
        <div className="container">
          <div class="row justify-content-center">
            <div class="section-title text-center pb-25">
              <h3 class="title mb-15">From The Blog</h3>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}
